var React = require('react');
var ReactDom = require('react-dom');
var TimerMixin = require('react-timer-mixin');
var $ = require('jquery');

import { Router, Route} from 'react-router';

// Firebase
var Rebase = require('re-base');
var base = Rebase.createClass('https://burning-heat-6791.firebaseio.com/');

var apiUrl = "http://localhost:8080/api/";

/*
 App
 */

var App = React.createClass({
    mixins: [TimerMixin],
    getInitialState: function() {
        return {showBlue: false, showYellow:false, showGreen:false, showRed: false, wait: 400, alert: "", game: {PlayersTurn: false, sequence:[], currentIndex: 0, gameId: "", score: 0}};
    },
    newGameId: function () {
        var that = this;
        var game = this.state.game;
        $.ajax({
            url: apiUrl + "newgame"
        }).then(function(data){
            console.log(data);
            var id = data.model.id;
            console.log(id);
            game.gameId = id;
            that.setState({game: game});
            that.playerSequence();
        })
    },
    scoreUp: function () {
        var game = this.state.game;
        var that = this;
        $.ajax({
            url: apiUrl + "incrementscore/" + encodeURIComponent(this.state.game.gameId)
        }).then(function(data){
            game.score = data.data.score;
            that.setState({game: game});
            that.setState({alert: "Score: " + data.data.score});
        })
    },
    componentDidMount: function () {
        //this.playerSequence();
    },
    handleBlue: function () {
        this.setState({showBlue: !this.state.showBlue});
    },
    handleYellow: function () {
        this.setState({showYellow: !this.state.showYellow});
    },
    handleGreen: function () {
        this.setState({showGreen: !this.state.showGreen});
    },
    handleRed: function () {
        this.setState({showRed: !this.state.showRed});
    },
    isColorCorrect: function(i) {
        var game = this.state.game;
        if(i == game.sequence[game.currentIndex]){
            console.log(i + " matches " + game.sequence[game.currentIndex]);
            game.currentIndex += 1;
            return true;
        }
        else
        {
            console.log(i + " does NOT match " + game.sequence[game.currentIndex]);
            return false;
        }
    },
    handleClick: function(i){
        var check = false;
        switch(i){
            case 1:
                this.handleBlue();
                check = this.isColorCorrect(i);
                break;
            case 2:
                this.handleYellow();
                check = this.isColorCorrect(i);
                console.log(check);
                break;
            case 3:
                this.handleGreen();
                check = this.isColorCorrect(i);
                console.log(check);
                break;
            case 4:
                this.handleRed();
                check = this.isColorCorrect(i);
                console.log(check);
                break;
        }
        if(!check){
            this.state.alert = "YOU LOSE, your score is " + this.state.game.score;
            this.state.game.PlayersTurn = false;
            this.state.game.sequence = [];
            this.state.game.currentIndex = 0;
            this.state.game.score = 0;
            return;
        }
        console.log(this.state.game.currentIndex + " " + this.state.game.sequence.length);

        if(this.state.game.currentIndex == this.state.game.sequence.length){
            this.scoreUp();
            this.state.game.PlayersTurn = false;
            this.state.game.currentIndex = 0;
            if(this.state.game.score % 6 == 0 && this.state.game.score < 10){
                this.state.wait -= 125;
            }
            this.playerSequence();
        }

    },
    playerSequence: function() {
        var game = this;
        var thisWait = game.state.wait + 300;
        this.state.game.sequence.push(Math.floor((Math.random() * 4) + 1));
        this.state.game.sequence.forEach(function (currNum, index) {
            setTimeout(function () {
                switch (currNum) {
                    case 1:
                        game.handleBlue();
                        break;
                    case 2:
                        game.handleYellow();
                        break;
                    case 3:
                        game.handleGreen();
                        break;
                    case 4:
                        game.handleRed();
                        break;

                }
                if(index == game.state.game.sequence.length-1){
                    game.state.game.PlayersTurn = true;
                }
            }, thisWait + game.state.wait);
            thisWait += game.state.wait + 300;
        });
    },
    newGame: function() {
        this.getInitialState();
        this.state.alert = "New game beginning!";
        this.newGameId();
    },
    render: function () {
        return (
            <div className="appContent">
                <div id="alert">
                    <h2 id="alertText">{this.state.alert}</h2>
                </div>
                <svg id="simonGame" preserveAspectRatio="xMidYMid" width="700" height="700" viewBox="0 0 700 700">
                    <circle cx="350" cy="350" r="350" className="cls-1"/>
                    <image onClick={this.state.game.PlayersTurn ? this.handleClick.bind(this, 1) : null} id="BlueOff" xlinkHref="data:img/png;base64," x="402" y="403" width="250" height="251"/>
                    { this.state.showBlue ? <BlueOn showBlue={this.state.showBlue} onClick={this.handleBlue} handleBlue={this.handleBlue} wait={this.state.wait}/> : null }
                    <image onClick={this.state.game.PlayersTurn ? this.handleClick.bind(this, 2) : null} id="YellowOff" xlinkHref="data:img/png;base64," x="52" y="403" width="251" height="251"/>
                    { this.state.showYellow ? <YellowOn showBlue={this.state.showYellow} onClick={this.handleYellow} handleYellow={this.handleYellow} wait={this.state.wait}/> : null }
                    <image onClick={this.state.game.PlayersTurn ? this.handleClick.bind(this, 3) : null} id="GreenOff" xlinkHref="data:img/png;base64," x="52" y="53" width="251" height="251"/>
                    { this.state.showGreen ? <GreenOn showGreen={this.state.showGreen} onClick={this.handleGreen} handleGreen={this.handleGreen} wait={this.state.wait}/> : null }
                    <image onClick={this.state.game.PlayersTurn ? this.handleClick.bind(this, 4) : null} id="RedOff" xlinkHref="data:img/png;base64," x="402" y="53" width="250" height="251"/>
                    { this.state.showRed ? <RedOn showRed={this.state.showRed} onClick={this.handleRed} handleRed={this.handleRed} wait={this.state.wait}/> : null }
                </svg>
                <div id = "topInfo">
                    <p>
                        <button id="newGame" src="./css/images/NewGameButton.png" onClick={this.newGame}><img src="./css/images/NewGameButton.png" /></button>
                        <button id="highScores" src="./css/images/HighScores.png" onClick={this.highScores}><img src="./css/images/HighScores.png" /></button>
                    </p>
                </div>

            </div>
        )
    }
});

var RedOn = React.createClass({
    mixins: [TimerMixin],
    componentDidMount: function () {
        this.setTimeout(function(){this.props.handleRed()}, this.props.wait);
    },
    handleRed: function() {
        this.props.handleRed()
    },
    render: function() {
        return (<image showRed={this.props.showRed} onClick={this.handleRed} id="RedOn" xlinkHref="data:img/png;base64," x="385" y="34" width="282" height="283"/>)
    }
});

var GreenOn = React.createClass({
    mixins: [TimerMixin],
    componentDidMount: function () {
        this.setTimeout(function(){this.props.handleGreen()}, this.props.wait);
    },
    handleGreen: function() {
        this.props.handleGreen()
    },
    render: function() {
        return (<image showGreen={this.props.showGreen} onClick={this.handleGreen} id="GreenOn" xlinkHref="data:img/png;base64," x="35" y="34" width="283" height="283"/>)
    }
});

var BlueOn = React.createClass({
    mixins: [TimerMixin],
    componentDidMount: function () {
        this.setTimeout(function(){this.props.handleBlue()}, this.props.wait);
    },
    handleRed: function() {
        this.props.handleBlue()
    },
    render: function() {
        return (<image showBlue={this.props.showBlue} onClick={this.handleBlue} id="BlueOn" xlinkHref="data:img/png;base64," x="385" y="384" width="282" height="283"/>)
    }
});

var YellowOn = React.createClass({
    mixins: [TimerMixin],
    componentDidMount: function () {
        this.setTimeout(function(){this.props.handleYellow()}, this.props.wait);
    },
    handleYellow: function() {
        this.props.handleYellow()
    },
    render: function() {
        return (<image showYellow={this.props.showYellow} onClick={this.handleYellow} id="YellowOn" xlinkHref="data:img/png;base64," x="35" y="384" width="283" height="283"/>)
    }
});

var routes = {};

ReactDom.render(<App />, document.querySelector('#main'));